`,paraId:17,tocIndex:10},{value:"\u53EA\u6709\u5F53\u5C5E\u6027\u540D\u4E0D\u5408\u6CD5\u65F6\u624D\u7528\u5F15\u53F7\u6269\u8D77\u6765\u3002",paraId:18,tocIndex:11},{value:'"quote-props": [2, "as-needed"]',paraId:18,tocIndex:11},{value:"\u4E3A\u4EC0\u4E48\uFF1F\u4E00\u822C\u60C5\u51B5\u4E0B\u6211\u4EEC\u8003\u8651\u5B83\u66F4\u5BB9\u6613\u9605\u8BFB\uFF0C\u53E6\u5916\u5B83\u80FD\u63D0\u4F9B\u8BED\u6CD5\u9AD8\u4EAE\uFF0C\u4EE5\u53CA\u66F4\u5BB9\u6613\u88AB\u8BB8\u591AJS\u5F15\u64CE\u4F18\u5316\u3002",paraId:19,tocIndex:11},{value:`// bad
const bad = {
	'foo': 3,
	'bar': 4,
	'data-blah': 5
};
// good
