`,paraId:31,tocIndex:18},{value:"\u9700\u8981\u56DE\u4F20\u591A\u4E2A\u503C\u65F6\uFF0C\u4F7F\u7528\u5BF9\u8C61\u89E3\u6784\uFF0C\u800C\u4E0D\u662F\u6570\u7EC4\u89E3\u6784\u3002",paraId:32,tocIndex:19},{value:"\u4E3A\u4EC0\u4E48\uFF1F\u589E\u52A0\u5C5E\u6027\u6216\u8005\u6539\u53D8\u6392\u5E8F\u4E0D\u4F1A\u6539\u53D8\u8C03\u7528\u65F6\u7684\u4F4D\u7F6E\u3002",paraId:33,tocIndex:19},{value:`// bad
function processInput(input) {
	return [left, right, top, bottom];
}
// \u8C03\u7528\u65F6\u9700\u8981\u8003\u8651\u56DE\u8C03\u6570\u636E\u7684\u987A\u5E8F\u3002
const [left, __, top] = processInput(input);
// good
function processInput(input) {
	return { left, right, top, bottom };
}
// \u8C03\u7528\u65F6\u53EA\u9009\u62E9\u9700\u8981\u7684\u6570\u636E
const { left, right } = processInput(input);
`,paraId:34,tocIndex:19},{value:"\u5B57\u7B26\u4E32\u4F7F\u7528\u5355\u5F15\u53F7''\u3002",paraId:35,tocIndex:21},{value:'"quotes": [2, "single"]',paraId:35,tocIndex:21},{value:`// bad
const name = "Capt. Janeway";
// good
