`,paraId:36,tocIndex:21},{value:"\u7A0B\u5E8F\u5316\u751F\u6210\u5B57\u7B26\u4E32\u65F6\uFF0C\u4F7F\u7528\u6A21\u677F\u5B57\u7B26\u4E32\u4EE3\u66FF\u5B57\u7B26\u4E32\u8FDE\u63A5\uFF0C\u5E76\u4E14\u6A21\u7248\u5B57\u7B26\u4E32\u4E2D\u7684\u53D8\u91CF\u4E24\u8FB9\u6CA1\u6709\u7A7A\u683C${variable}\u3002",paraId:37,tocIndex:22},{value:'"prefer-template": 1',paraId:37,tocIndex:22},{value:"\uFF0C",paraId:37,tocIndex:22},{value:'"template-curly-spacing": 2',paraId:37,tocIndex:22},{value:"\u4E3A\u4EC0\u4E48\uFF1F\u6A21\u677F\u5B57\u7B26\u4E32\u66F4\u4E3A\u7B80\u6D01\uFF0C\u66F4\u5177\u53EF\u8BFB\u6027\u3002",paraId:38,tocIndex:22},{value:`// bad
function sayHi(name) {
	return 'How are you, ' + name + '?';
}
// bad
